import React, {useState} from "react";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import Card from "@mui/material/Card";
import Link from "@mui/material/Link";
import PillLogo from './pill.svg';
import TextField from "@mui/material/TextField";

export default function Login() {
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");

    // Styles and SX
    const boxSx = {
        "& .MuiTextField-root": {mb: 5, width: "100%"},
    }

    const buttonSx = {
        fontSize: "17px",
        height: "5.75ch",
        width: "100%"
    };

    const containerDivStyle = {
        alignItems: "center",
        display: "flex",
        flexDirection: "column",
        justifyContent: "center"
    };

    const cardSx = {
        ml: 5,
        mt: 5,
        mr: 5,
        p: 5
    };

    const imgStyle = {
        filter: "invert(100%) sepia(0%) saturate(0%) hue-rotate(231deg) brightness(103%) contrast(101%)",
        height: "250px"
    };

    const disabledButton = () => {
        return username.length > 0 && password.length > 0;
    };

    const handleSubmit = e => {
        e.preventDefault();
        console.log(username, password);
    };

    return (
        <div style={containerDivStyle}>
            <div>
                <img alt="Pill Logo" src={PillLogo} style={imgStyle}/>
            </div>

            <Card variant="outlined" sx={cardSx}>
                <form onSubmit={handleSubmit}>
                    <Box
                        sx={boxSx}
                    >
                        <TextField
                            required
                            id="userInput"
                            label="Username"
                            name="userInput"
                            onChange={e => setUsername(e.target.value)}
                            type="search"
                            value={username}
                        />

                        <TextField
                            required
                            id="passwordInput"
                            label="Password"
                            name="passwordInput"
                            onChange={e => setPassword(e.target.value)}
                            type="search"
                            value={password}
                        />

                        <Button disabled={!disabledButton()}
                                size="large" sx={buttonSx} type="submit"
                                variant="contained">Login</Button>
                    </Box>
                </form>

                <Link href="#" underline="hover">
                    {"Create an account"}
                </Link>
            </Card>
        </div>
    );
}
